script: |
  super -f text -I q9552.spq | sort > q9552.out

inputs:
  - name: q9552.spq
    data: |
      SELECT ALL col0 + col2 + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( - col0 / + cor0.col2 ) OR NULL NOT BETWEEN NULL AND ( + col2 * + col0 );
  - name: tab0

outputs:
  - name: q9552.out
    data: |
      260
      71
      81
